import React, { Component } from 'react'

class NavMenu extends Component {
    
    
    constructor(props) {
        super(props)
    
        this.state = {
             questionToJump:""
        }
    }
    
    onQuestion1 = (event) => {
        event.preventDefault();
        
        this.setState({
            currentAnswerValue: "q1"
        })
        

    }

    onQuestion1a = (event) => {
        event.preventDefault();
        
        this.setState({
            currentAnswerValue: "q1a"
        })

    }

    onQuestion2 = (event) => {
        event.preventDefault();
        
        this.setState({
            currentAnswerValue: "q2"
        })
        

    }

    onQuestion3 = (event) => {
        event.preventDefault();
        
        this.setState({
            currentAnswerValue: "q3"
        })
        

    }

    onQuestion4 = (event) => {
        event.preventDefault();
        
        this.setState({
            currentAnswerValue: "q4"
        })
        

    }

    onSubmit = (event) => {
        const currentAnswerValue = this.state;
        
        if(currentAnswerValue === "q1"){
            this.props.onSubmit(currentAnswerValue);
        }

        if(currentAnswerValue === "q1a"){
            this.props.onSubmit(currentAnswerValue);
        }

        if(currentAnswerValue === "q2"){
            this.props.onSubmit(currentAnswerValue);
        }

        if(currentAnswerValue === "q3"){
            this.props.onSubmit(currentAnswerValue);
        }

        if(currentAnswerValue === "q4"){
            this.props.onSubmit(currentAnswerValue);
        }
    }


    render() {
        return (
            <div>
                <div className="navigation-buttons-container">
                    <h1>Jump to....</h1>
                    <button type="submit" value="question1" className="jumpq1-question-btn" onClick={this.onSubmit}>Question 1</button>
                    <button type="submit" value="question1a" className="jumpq1a-question-btn" onClick={this.onSubmit}>Question 1a</button>
                    <button type="submit" value="question2" className="jumpq2-question-btn" onClick={this.onSubmit}>Question 2</button>
                    <button type="submit" value="question3" className="jumpq3-question-btn" onClick={this.onSubmit}>Question 3</button>
                    <button type="submit" value="question4" className="jumpq4-question-btn" onClick={this.onSubmit}>Question 4</button>
                </div>
            </div>
        )
    }
}

export default NavMenu
